		/// <para>The email address of CC recipient</para>
		/// <example>cc.user1@example.com</example>
		///</summary>
		[JsonPropertyName("cc.address"), DataMember(Name = "cc.address")]
		public string[] CcAddress { get; set; }

		///<summary>
		/// <para><c>email.content_type</c></para>
